-- Sample Stored Procedure Call and Result Check\nDECLARE @ExpectedCount INT = 5;\nDECLARE @ActualCount INT;\n\nEXEC GetActiveUsers @status = 'active', @count = @ActualCount OUTPUT;\n\nIF @ActualCount = @ExpectedCount\n    PRINT 'Test Passed: Correct number of active users returned.'\nELSE\n    PRINT 'Test Failed: Incorrect number of active users. Expected: ' + CAST(@ExpectedCount AS VARCHAR) + ', but got: ' + CAST(@ActualCount AS VARCHAR);